script: |
  super -f text -I q7035.spq | sort > q7035.out

inputs:
  - name: q7035.spq
    data: |
      SELECT ALL - 35 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + - col0 BETWEEN ( NULL ) AND ( - col2 * col2 );
  - name: tab0

outputs:
  - name: q7035.out
    data: |
      -35
      -35
      -35
